// Link is a react-router-dom component used as an anchor tag for routing
const Header = () => (
  <HeaderComponent>
    <div className="row">
      <h1>
        <Link to="/" href="/">
         Nicolas Bergues Assesment 
        </Link>
      </h1>
    </div>
  </HeaderComponent>
);

export default Header;
